import korm from "../../../Home/korm.png";
import animal from "../../../Home/amimal.png";
import snaraga from "../../../Home/snaraga.png";
import {useEffect, useState} from "react";
import axios from "axios";
import dog from './dog.json'

function HameAnimal(){
    //const urlBrowser =" https://github.com/dariusk/corpora/blob/master/data/animals/dogs.json"
    const urlBrowser = {dog};
    const [contactData, setContactData] = useState([])
    useEffect(() => {
        axios.get(urlBrowser).then((res) => {
            setContactData(res.data)

        });
    },[])

    return(
        <div>
            <tbody>
            {contactData.map(
                item => (
                    <tr key={item.id}>
                        <td>{item}</td>
                        <td>{item.Vizsla}</td>
                        <td>{item.lastName}</td>
                        <td>{item.age}</td>
                        <td>{item.phone}</td>
                    </tr>
                ))}
            </tbody>
        </div>
    )
}
export default HameAnimal;
